import React from 'react'
import ReactDOM from 'react-dom'

//Component
import Header from './component/header'
const FirstJourney = () => {
  return (
    <h1> Hello Hero </h1>
  )
}

const SecondJourney = () => {
  return (
    <input type="text" placeholder="please insert your name" />
  )
}

const ThirdJourney = () => {
  return (
    <div>
      <Header/>
      <FirstJourney/>
      <SecondJourney/>
    </div>
  )
}

ReactDOM.render(<ThirdJourney/>,document.getElementById('root'));
